// Helper functions
export function getTransactionsByItem(itemId: string): InventoryTransaction[] {
  return inventoryTransactions.filter(t => t.itemId === itemId);
}

export function getTransactionsByDateRange(startDate: string, endDate: string): InventoryTransaction[] {
  return inventoryTransactions.filter(t =>
    t.dateTime >= startDate && t.dateTime <= endDate
  );
}

export function getTransactionsByType(type: InventoryTransaction['type']): InventoryTransaction[] {
  return inventoryTransactions.filter(t => t.type === type);
}

export function getRecentTransactions(limit: number = 50): InventoryTransaction[] {
  return inventoryTransactions.slice(0, limit);
}

export function getTransactionsByReference(referenceNumber: string): InventoryTransaction[] {
  return inventoryTransactions.filter(t => t.referenceNumber === referenceNumber);
}

// Get unique job numbers (reference numbers for deliveries)
export function getUniqueJobNumbers(): string[] {
  const jobs = new Set(
    inventoryTransactions
      .filter(t => t.type === 'delivery')
      .map(t => t.referenceNumber)
  );
  return Array.from(jobs).sort((a, b) => parseInt(b) - parseInt(a));
}

// Get transaction statistics
export function getTransactionStats() {
  const deliveries = inventoryTransactions.filter(t => t.type === 'delivery');
  const restocks = inventoryTransactions.filter(t => t.type === 'restock');

  const totalDeliveries = deliveries.length;
  const totalRestocks = restocks.length;

  const deliveryValue = deliveries.reduce((sum, t) => sum + (Math.abs(t.amount) * t.price), 0);
  const restockCost = restocks.reduce((sum, t) => sum + (t.amount * t.cost), 0);

  return {
    totalTransactions: inventoryTransactions.length,
    deliveryCount: totalDeliveries,
    restockCount: totalRestocks,
    totalDeliveryValue: deliveryValue,
    totalRestockCost: restockCost,
    profitMargin: deliveryValue - restockCost,
    uniqueJobs: getUniqueJobNumbers().length
  };
}

// Get monthly summary
export function getMonthlySummary(year: number, month: number) {
  const monthStr = String(month).padStart(2, '0');
  const startDate = `${year}-${monthStr}-01`;
  const endDate = `${year}-${monthStr}-31`;

  const monthTransactions = getTransactionsByDateRange(startDate, endDate + 'T23:59:59');

  const deliveries = monthTransactions.filter(t => t.type === 'delivery');
  const restocks = monthTransactions.filter(t => t.type === 'restock');

  return {
    month: new Date(year, month - 1).toLocaleString('default', { month: 'long', year: 'numeric' }),
    deliveryCount: deliveries.length,
    restockCount: restocks.length,
    deliveryValue: deliveries.reduce((sum, t) => sum + (Math.abs(t.amount) * t.price), 0),
    restockCost: restocks.reduce((sum, t) => sum + (t.amount * t.cost), 0),
    uniqueItems: new Set(monthTransactions.map(t => t.itemId)).size,
    uniqueJobs: new Set(deliveries.map(t => t.referenceNumber)).size
  };
}

// Get job summary (all materials for a specific job)
export function getJobSummary(referenceNumber: string) {
  const jobTransactions = getTransactionsByReference(referenceNumber);
  const materials: Record<string, { itemId: string; quantity: number; totalCost: number; totalPrice: number }> = {};
  
  jobTransactions.forEach(t => {
    if (!materials[t.itemId]) {
      materials[t.itemId] = { itemId: t.itemId, quantity: 0, totalCost: 0, totalPrice: 0 };
    }
    materials[t.itemId].quantity += Math.abs(t.amount);
    materials[t.itemId].totalCost += Math.abs(t.amount) * t.cost;
    materials[t.itemId].totalPrice += Math.abs(t.amount) * t.price;
  });
  
  return {
    referenceNumber,
    transactionCount: jobTransactions.length,
    materials: Object.values(materials),
    totalCost: Object.values(materials).reduce((sum, m) => sum + m.totalCost, 0),
    totalPrice: Object.values(materials).reduce((sum, m) => sum + m.totalPrice, 0),
    firstTransaction: jobTransactions[jobTransactions.length - 1]?.dateTime,
    lastTransaction: jobTransactions[0]?.dateTime
  };
}
